contract Ownable {

    //  1) create a private '_owner' variable of type address with a public getter function
    address private _owner;
    function owner() public view returns (address) {
        return _owner;
    }

    //  2) create an internal constructor that sets the _owner var to the creator of the contract
    constructor () {
        _owner = msg.sender;
        emit OwnershipTransferred(address(0), _owner);
    }

    //  3) create an 'onlyOwner' modifier that throws if called by any account other than the owner.
    modifier onlyOwner() {
        require(msg.sender == _owner, 'caller must be the owner');
        _;
    }

    //  4) fill out the transferOwnership function
    function transferOwnership(address newOwner) public onlyOwner {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }

    //  5) create an event that emits anytime ownerShip is transferred (including in the constructor)
    event OwnershipTransferred(address oldOwner, address newOwner);
}

contract Pausable is Ownable {

    //  1) create a private '_paused' variable of type bool
    bool private _paused;

    //  2) create a public setter using the inherited onlyOwner modifier
    function setPaused(bool pause) public onlyOwner {
        _paused = pause;
        if (pause) emit Paused(msg.sender);
        else emit Unpaused(msg.sender);
    }
    //  3) create an internal constructor that sets the _paused variable to false
    constructor () {
        _paused = false;
    }

    //  4) create 'whenNotPaused' & 'paused' modifier that throws in the appropriate situation
    modifier whenNotPaused() {
        require(!_paused, "contract mustn't be paused");
        _;
    }

    modifier paused() {
        require(_paused, "contract must be paused");
        _;
    }

    //  5) create a Paused & Unpaused event that emits the address that triggered the event
    event Paused(address adr);
    event Unpaused(address adr);
}

