contract ERC721Metadata is ERC721Enumerable {

    // Create private vars for token _name, _symbol, and _baseTokenURI (string)
    string private _name;
    string private _symbol;
    string private _baseTokenURI;

    // create private mapping of tokenId's to token uri's called '_tokenURIs'
    mapping(uint256 => string) private _tokenURIs;

    bytes4 private constant _INTERFACE_ID_ERC721_METADATA = 0x5b5e139f;
    /*
     * 0x5b5e139f ===
     *     bytes4(keccak256('name()')) ^
     *     bytes4(keccak256('symbol()')) ^
     *     bytes4(keccak256('tokenURI(uint256)'))
     */


    constructor (string memory __name, string memory __symbol, string memory __baseTokenURI) {
        // set instance var values
        _name = __name;
        _symbol = __symbol;
        _baseTokenURI = __baseTokenURI;
        _registerInterface(_INTERFACE_ID_ERC721_METADATA);
    }

    // create external getter functions for name, symbol, and baseTokenURI
    function name() external view returns (string memory) {
        return _name;
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function baseTokenURI() external view returns (string memory) {
        return _baseTokenURI;
    }

    function tokenURI(uint256 tokenId) external view returns (string memory) {
        require(_exists(tokenId), 'tokenId does not exist');
        return _tokenURIs[tokenId];
    }

    // Create an internal function to set the tokenURI of a specified tokenId
    // It should be the _baseTokenURI + the tokenId in string form
    // require the token exists before setting
    function setTokenURI(uint256 tokenId) internal {
        require(_exists(tokenId), 'tokenId does not exist');
        string memory str = uint2str(tokenId);
        _tokenURIs[tokenId] = string(abi.encodePacked(_baseTokenURI, str));
    }

    function uint2str(uint256 _i) internal pure returns (string memory str) {
        if (_i == 0) {
            return "0";
        }
        uint256 j = _i;
        uint256 len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint256 k = len;
        j = _i;
        while (j != 0) {
            bstr[--k] = bytes1(uint8(48 + j % 10));
            j /= 10;
        }
        str = string(bstr);
    }
}

